import React from 'react';
import { StyleSheet,Dimensions  } from 'react-native';

const StyleButtonList = StyleSheet.create({
    button:{
        width:"90%",
        height:"5%",
        backgroundColor:'red'
    }
});

export default StyleButtonList;
